import React from 'react';
import { SearchIcon } from '@heroicons/react/24/outline';

// Import profile pictures (assuming you have these images)
import tino from '../images/tino.png';
import sarath from '../images/sarath.png';
import john from '../images/john.png';
import vikaas from '../images/vikaas.png';
import dharshu from '../images/dharshu.png';
import mathi from '../images/mathi.png';
import sridhar from '../images/sridhar.png';
import nandhini from '../images/nandhini.png';
import raagini from '../images/raagini.png';

const Contacts1 = ({ darkMode }) => {
  const contacts = [
    { name: 'Tino', sip: '701', img: tino },
    { name: 'Sarath', sip: '702', img: sarath },
    { name: 'John', sip: '703', img: john },
    { name: 'Vikaas', sip: '704', img: vikaas },
    { name: 'Dharshu', sip: '705', img: dharshu },
    { name: 'Mathi', sip: '706', img: mathi },
    { name: 'Sridhar', sip: '707', img: sridhar },
    { name: 'Nandhini', sip: '708', img: nandhini },
    { name: 'Raagini', sip: '709', img: raagini },
    // ... (repeat the above contacts to have more entries)
  ];

  return (
    <div className={`${darkMode ? 'dark' : ''}`}>
      <div className="mb-6">
        <div className="relative">
          <input
            type="text"
            placeholder="Search contacts..."
            className="w-full pl-10 pr-4 py-2 rounded-full border border-gray-300 dark:border-gray-600 bg-white dark:bg-gray-700 text-gray-900 dark:text-white focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
          <SearchIcon className="absolute left-3 top-2.5 h-5 w-5 text-gray-400" />
        </div>
      </div>
      <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-4 lg:grid-cols-5 gap-4">
        {contacts.map((contact) => (
          <div
            key={contact.sip}
            className="flex flex-col items-center bg-white dark:bg-gray-800 p-4 rounded-lg shadow-md hover:shadow-lg transition-shadow duration-300"
          >
            <img
              src={contact.img}
              alt={contact.name}
              className="w-16 h-16 rounded-full object-cover border-2 border-blue-500"
            />
            <h3 className="mt-2 text-sm font-semibold text-gray-700 dark:text-gray-200">{contact.name}</h3>
            <p className="text-xs text-gray-500 dark:text-gray-400">SIP: {contact.sip}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Contacts1;
